class BeatsContainer extends React.Component {
    renderBox(id){
        BeatBox.render(id);
    }
    render() {
        return React.createElement(
            'div', {
                className: 'beats-container'
            },
            this.renderBox(0),
            this.renderBox(1),
            this.renderBox(2),
            this.renderBox(3),
            this.renderBox(4),
            this.renderBox(5),
            this.renderBox(6),
            this.renderBox(7),
            this.renderBox(8)
        );
    }
}

class BeatBox extends React.Component {
    render() {
        return React.createElement(
            'div', {
                className: 'beat-box',
                id: this.props.id
            }
        );
    }
}

ReactDOM.render(
    <BeatsContainer/>,
    document.getElementById('root')
);
